--
-- Table structure for table `zm_video_list_del`
--

DROP TABLE IF EXISTS `zm_video_list_del`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `zm_video_list_del` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '文件名: 机身编号@生成日期 ',
  `pfilename` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '前一文件名，衔接打包文件',
  `bfilename` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件别名',
  `createdate` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建日期',
  `filelen` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件长度',
  `playfilelen` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件播放长度',
  `filetype` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件类型',
  `hostname` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '主机名（执法者姓名）',
  `hostcode` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '主机编号（执法者[如：警员]编号）',
  `hostbody` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机身编号（记录仪编号）',
  `danwei` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '单位',
  `onlyread` int(11) DEFAULT '0' COMMENT '只读属性 0-读写  1-只读',
  `safejb` int(11) DEFAULT '0' COMMENT '安全级别 0- 1- 2- 3- 4-',
  `caserank` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '案件等级',
  `casetopic` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '案件专题编号',
  `note` longtext COLLATE utf8_unicode_ci COMMENT '注备',
  `serverurl` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `servername` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '服务器名称',
  `thumb` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '缩略图',
  `saveposition` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '存储位置',
  `playposition` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '播放位置',
  `macposition` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '存储的物理路径',
  `media_play_url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '播放位置',
  `source_type` char(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '判断播放位置',
  `querys` int(11) DEFAULT '0' COMMENT '查询次数',
  `downloads` int(11) DEFAULT '0' COMMENT '下载次数',
  `opens` int(11) DEFAULT '0' COMMENT '播点次数',
  `sort` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '分类',
  `autodel` int(11) DEFAULT '0' COMMENT '自动删除标识',
  `isdel` int(11) DEFAULT '0' COMMENT '是否删除标识 0-未删除 1-已删除',
  `deluser` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '删除人',
  `deldate` int(11) DEFAULT NULL COMMENT '除删时间',
  `uploaddate` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '上传时间',
  `creater` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建人',
  `moder` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '修改人',
  `modtime` int(11) DEFAULT NULL COMMENT '修改时间',
  `major` char(1) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '0=不重要，1=重要',
  `playtime` int(11) DEFAULT NULL COMMENT '视频播放时间长度',
  `hot` int(1) DEFAULT '0' COMMENT '0=普通，1=热点',
  `filecomment` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件评论',
  `resolution` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '视频像素分辨率',
  `filetotnum` int(11) NOT NULL DEFAULT '0' COMMENT '此事件共有视频文件的个数',
  `filetottime` int(11) NOT NULL DEFAULT '0' COMMENT '此事件所有视频文件的总时长',
  `vio_jdsbh` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `conn_type` int(2) DEFAULT NULL,
  `save_date` int(11) DEFAULT NULL COMMENT '存储天数',
